<p>Suppose we have trajectory T1 that has an event marker E1, with a command C1 associated with it.<br>
Let’s say C1 is “ElevatorUp”</p>
<p>Suppose our Auto has<br>
= T1<br>
= C2</p>
<p>in sequence where C2 is a command sequence that should run where T1 ends.</p>
<p>If certain commands are placed inside C2, T1 will stop driving early (usually at the E1 point), though it will run both C1 and C2 (or in some cases not run C2)<br>
If C2 simply has PrintCommand, everything runs just fine. So, it’s definitely dependencies-related or something similar.</p>
<p>The solution so far was:</p>
<ol>
<li>Not to use commands with event markers</li>
<li>Instead of Auto create external sequence where Waitcommand+C1 is done ALONGWITH T1, and then C2 is done.</li>
</ol>
<p>Any idea why this is happening?</p>
<p>As an example - this works fine:</p>
